import React, { Component } from "react";
import "../App.css";
export class Videos extends Component {
  render() {
    return (
      <div class="parent">
        <div class="child">
          <video width="480" height="480" id="v1" alt="1" controls>
            <source src="video1.mp4" type="video/mp4" />
          </video>
        </div>
        <div class="child">
          <video width="480" height="480" id="v2" alt="2" controls>
            <source src="video2.mp4" type="video/mp4" />
          </video>
        </div>
        <div class="child">
          <video width="480" height="480" id="v3" alt="2" controls>
            <source src="video3.mp4" type="video/mp4" />
          </video>
        </div>
      </div>
    );
  }
}
export default Videos;
